import React,{ useState,useEffect}from "react";
import { Link } from "react-router-dom";
import axios from 'axios'
const Biosample = () => {
  const [Datas, setDatas] = useState([])

    const fetchData = async () => {
        const result = await axios.get('http://127.0.0.1:8000/api/biosample/');

        console.log(result.data)
        setDatas(result.data)
    }

    useEffect(() => {
        fetchData();
    }, [])

    // const goToDetail = () => {
    //     alert("detail page")
    // }



    const rows = Datas.map((item) => (
      <tr key={item.id}>
        <td><Link to={`/${item.id}`} style={{textDecoration:'none'}}>{item.biosample_id}</Link></td>
        <td>{item.biosample_type}</td>
        <td>{item.biosample_name}</td>
        <td>{item.biosample_path}</td>
        <td>{item.library_id}</td>
        <td>{item.biosample_created_on}</td>


      </tr>
    ));
    return (
      <div>
        <div className="page-header">
          <h3 className="page-title">BioSampleLists </h3>
        </div>

        <div className="row">
          <div className="col-12 grid-margin">
            <div className="card">


              <div className="card-body">


                <div class="text-center">
                  <Link
                    to="/basespace/addbiosample"
                    className="btn btn-secondary text-dark"
                    style={{ backgroundColor: "#fec107" }}
                  >
                    {" "}
                    ADD DETAILS
                  </Link>
                </div>
                <hr />

                <div className="table-responsive">
                  <table className="table table-bordered  table-hover">
                    <thead>
                      <tr>
                        <th>
                          <strong>BioSampleId</strong>
                        </th>
                        <th>
                          {" "}
                          <strong> BioSmapleType</strong>{" "}
                        </th>
                        <th>
                          {" "}
                          <strong>BioSampleName</strong>{" "}
                        </th>
                        <th>
                          {" "}
                          <strong>BioSamplePath</strong>{" "}
                        </th>
                        <th>
                          <strong>LibraryId</strong>{" "}
                        </th>
                        <th>
                          {" "}
                          <strong> Created On</strong>{" "}
                        </th>
                      </tr>
                    </thead>
                    <tbody>{rows}</tbody>
                  </table>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }

export default Biosample;
